import React from 'react';
import ProductList from '../componentes/ListaProductos';

const Home = () => {
  const products = [
    { id: 1, name: 'Producto 1', price: 10 },
    { id: 2, name: 'Producto 2', price: 15 },
    { id: 3, name: 'Producto 3', price: 20 },
  ];

  return (
    <div>
      <h1>Tienda</h1>
      <ProductList products={products} />
    </div>
  );
};

export default Home;
